import "../Style/header.css"
import myImage from '../Images/LilSkull_white.png';

function Header() {
    return (
        <nav>
            <img src={myImage} width={30} height={30} alt="LittleSkullIcon" />
            <div className="collapse navbar-collapse">
                <ul className="d-flex flex-row-reverse">
                    <p>ABOUT</p>
                    <p>PROJECTS</p>
                    <p>CONTACT</p>
                </ul>
            </div>
        </nav>
    );
}

export default Header;
